import React from 'react';
import { Form } from 'react-bootstrap';
import Video from '../../Video/networking2.mp4';
import {
	HeroContainer,
	HeroBg,
	VideoBg,
	Herotext,
	HeroH1,
	HeroP,
} from './HeroElement';

const HeroSections = () => {
	return (
		<HeroContainer>
			<HeroBg>
				<VideoBg autoPlay loop muted src={Video} type="video/mp4" />
			</HeroBg>
			<Herotext>
				<HeroH1>I'm a full stack Developer</HeroH1>
				<HeroP>
					I am results-oriented individual with unique background in computer
					science and software engineering.
				</HeroP>
			</Herotext>
		</HeroContainer>
	);
};

export default HeroSections;
